STNG:0"三田内阁"

STNG_desc:0"三田内阁是由前藤田财阀的三兄弟“藤田房太郎”、“藤田小太郎”和“藤田平太郎”领导下的内阁。三人在家族经营矿山破产后背负巨额外债，在还债的途中三人开始关注政界的发展。在最后与家族协商后三人投身于政界，并于维新初期便加入自由党，成为党内的元老。\n在自由党重组后，三人积极奔走于星亨身侧，得到了星的极大关照。在后续的民进党中，三人致力于改革党政，将党权从评议会收为党首，并于大正年间成功组阁，在三人的推动下缔造了划时代的《1914年协定》，该协定创造了长期维持执政党民进党与在野党帝政党的两党政治格局。\n虽然在后续的民进党发展中三田被迫放弃了其党首集权，但民进党仍然被其牢牢把握，促进了民进党的稳定发展，并推动了名望政治的破产，使其成为日本最受欢迎的三位政治家。\n时至今日，在党内反对份子的强烈要求下，三田即将隐退之际，或许也告知世人们，民进党与1914年协定的崩溃，帝政党与其他各个在野党也希望打破该体制以构筑其余政党执政的格局。"

